import React from 'react'
import { Link } from 'react-router-dom';

const featuring = () => {
  return (
    <div className="title-section">
    <h1 className="title">Featuring</h1>
    <div className="image-gallery">
      <Link path to='/activision'>
      <img src="/images/activisionlogo.png"  className="gallery-image" />
      </Link>

      <img src="/images/ealogo.png"  className="gallery-image" />
      <img src="/images/valvelogo.png"  className="gallery-image" />
      <img src="/images/riotlogo.png"  className="gallery-image" />
      <img src="/images/epicgameslogo.png"  className="gallery-image" />
    </div>
  </div>
  );
}

export default featuring
